import {UseState} from "react";

const Example = () => {
  let valArray = useState("hello");
  // console.log(valArray)
  return (
    <>
      <input
       type="text"
       onChange={(e) => {
        const setFn = valArray[1]
        setFn(e.target.value)
       }} /> = {valArray[0]}
    </>
  );
};

export default Example;
